import Card from "../../UI/Card/card";
import Classes from "./nextWeekWeather.module.css";

const nextWeekWeather = (props) => {
  return (
    <div className={Classes.nextWeekWeather}>
      {props.DailyForecasts.map((forcast) => {
        return (
          <Card class={Classes.nextWeekCard}>
            <h4>{forcast.day}</h4>
            <div>
              min:{forcast.min} max:{forcast.max}
            </div>
            <img
              src={
                "https://developer.accuweather.com/sites/default/files/" +
                props.nextWeekWeather +
                "-s.png"
              }
              loading="lazy"
            ></img>
          </Card>
        );
      })}
    </div>
  );
};

export default nextWeekWeather;

nextWeekWeather.defaultProps = {
  DailyForecasts: [
    {
      day: "Sunday",
      min: 5,
      max: 15,
      src: "04",
    },
